    if (arr[i].charCodeAt() >=65 && arr[i].charCodeAt() <=90 ) {
      if (arr[i].charCodeAt()-13 >= 65){
        arr[i] = String.fromCharCode(parseInt(arr[i].charCodeAt()-13))
